import React from 'react'
import { Link } from 'react-router-dom/cjs/react-router-dom.min'
const Main = () => {
    return (
        <div className='main'>
            <Link to="/register" className="btn btn-primary">Register</Link>
            <Link to="/login" className="btn btn-danger">Login</Link>
        </div>
    )
}

export default Main
